import React, { useState } from "react";
import classes from "./RentalAgreement.module.css";
import { Grid } from "@mui/material";
import moment from "moment";
import { Button, Form, Alert } from "react-bootstrap";
import connection from "../../axios";

function RentalAgreement() {
    const [count, setCount] = useState(0);
    const [rentingShow, setRentingShow] = useState([]);
    const [errorMessage, setErrorMessage] = useState(""); // To store error messages

    const sendForm = () => {
        connection.get("/api/rentings/show?", { params: { idRenting: count } })
            .then((response) => {
                console.log("OK! ");
                console.log(response);
                setRentingShow(response.data);
                setErrorMessage(""); // Clear previous error messages
            })
            .catch((errorResponse) => {
                console.log("ErRoR: " + errorResponse);
                setErrorMessage("Failed to retrieve data. Please try again."); // Set error message
            });
    };

    const changeCount = (event) => {
        const value = event.target.value;
        console.log(value);
        setCount(value);
    };

    return (
        <div>
            <Form>
                <Form.Group className={classes.Label}>
                    <Form.Label>Podaj nr Umowy</Form.Label>
                    <Form.Control type={'number'} onChange={changeCount} />
                    <Form.Text className={'text-bg-dark'}>
                        Formularz przekieruję Cię do Umowy wypożyczenia
                    </Form.Text>
                </Form.Group>
                <Button className={classes.FormButtonSubmit} variant={'dark'} onClick={sendForm}>
                    Wyślij
                </Button>
            </Form>
            {errorMessage && <Alert variant="danger">{errorMessage}</Alert>} {/* Display error message */}
            {
                rentingShow.length > 0 ? (
                    rentingShow.map(value => {

                        //Formatuję datę wypozyczenia
                        var dataWypo = value.dateRenting;
                        var dateRentingFormat = moment(dataWypo).format('DD/MM/YY HH:mm'); // Corrected to 'mm' for minutes


                        return (
                            <Grid key={value.idRenting} container className={classes.TableRow}>
                                <Grid item xs={12} justifyContent={"center"}>
                                    <h4>Umowa wypożyczenia o nr: {value.idRenting}</h4>
                                </Grid>
                                <Grid item xs={12}>Została zawarta z datą: {dateRentingFormat} godzina.</Grid>
                                <Grid item xs={12}>Od firmy: Mandragora Grzegorz Puławski NIP 9531028160:</Grid>
                                <Grid item xs={12}>Pani/Pan : {value.firstName}</Grid>
                                <Grid item xs={12}>nazwisko: {value.lastName}</Grid>
                                <Grid item xs={12}>Nr telefonu kontaktowego: {value.phoneNumber}</Grid>
                                <Grid item xs={12}>Nr dowodu: {value.identityCard}</Grid>
                                <Grid item xs={12}>Wypożycza komplet zimowy o nazwie : {value.nameEquipment}</Grid>
                                <Grid item xs={12}>W cenie za dobę: {value.priceEquipment} zł</Grid>
                                <Grid item xs={12}>
                                    Klient zobowiązuję się zwrócić sprzęt w stanie niepogorszonym. W przypadku uszkodzenia, kradzieży zobowiązuje się do pokrycia kosztów odtworzenia.
                                </Grid>
                                <Grid item xs={12} justifyContent={"flex-end"}>CZYTELNY PODPIS KLIENTA:</Grid>
                            </Grid>
                        );
                    })
                ) : (
                    <div>Nie znaleziono umowy wypożyczenia.</div> // Handle empty response
                )
            }
            <div className={classes.ButtonPrint}>
                <Button onClick={window.print}>drukuj</Button>
            </div>
        </div>
    );
}

export default RentalAgreement;
